  return (
    <div style={{ width:"200px", height:"100px"}}>
       <div>
            <div>
                <p1>Trinamool Congress leader Mahua Moitra who was expelled
                 vacated her government bungalow in Delhi at 10 am today, January 19, Friday.
                 </p1>
            </div>
            <Button variant="outline-primary">sumit</Button>
                 <Button variant="outline-primary" onClick={CloseModal}>Accept it</Button>
        </div>
    </div>
  )
}
export default MyModal
